        ArrayList<Long> result = new ArrayList<Long>();
        ArrayList<Long> primes = new ArrayList<Long>();
        for (long i = 2; i * i <= n; ++i) {
            if (n % i == 0) {
                primes.add(i);
                n /= i;
            }
        }
        if (n != 1) {
            primes.add(n);
        }
        for (long prime : primes) {
            int i = 1;
            while (n % prime == 0) {
                n /= prime;
                ++i;
            }
            result.add(prime);
        }
        return result;

