    // >>> countUpTo((18l))
    // (new ArrayList<Long>(Arrays.asList((long)2l, (long)3l, (long)5l, (long)7l, (long)11l, (long)13l, (long)17l)))
    public static ArrayList<Long> countUpTo(long n) {
        if (n <= 1) {
            return new ArrayList<Long>(Arrays.asList());
        }
        // Start with 2, since the algorithm will mark 1 as not prime
        // if prime < current, it means prime is a multiple of current
        long current = 2;
        ArrayList<Long> primes = new ArrayList<Long>(Arrays.asList(current));
        while (current * current < n) {
            if (primes.size() != 0 && primes.get(primes.size() - 1) == current) {
                current++;
                continue;
            }
            primes.add(current);
            for (long prime : primes) {
                // If prime is a multiple of current, remove prime
                if (prime * prime > n || current * current >= n) {
                    break;
                }
                if (current % prime == 0) {
                    primes.remove(primes.indexOf(prime));
                    break;
                }
            }
            current++;
        }
        return primes;

