        // Lists of tuples (line number, even count) and (line number, odd count)
        ArrayList<Pair<Integer, Integer>> evenList = new ArrayList<>();
        ArrayList<Pair<Integer, Integer>> oddList = new ArrayList<>();
        // Loop through each line
        for (int i = 0; i < lst.size(); i++) {
            // Count how many even and odd digits are in the line
            int count = 0;
            int countOdd = 0;
            for (int j = 0; j < lst.get(i).length(); j++) {
                if (Integer.parseInt(lst.get(i).substring(j, j + 1)) % 2 == 0)
                    count++;
                else
                    countOdd++;
            }
            // Add the (line number, count) to the list of that number
            if (count % 2 == 0)
                evenList.add(new Pair<Integer, Integer>(i + 1, count));
            else
                oddList.add(new Pair<Integer, Integer>(i + 1, count));
