        Collections.sort(oddList);
        // Reverse the odd list
        Collections.reverse(oddList);
        // Initialize the answer
        ArrayList<String> answer = new ArrayList<>();
        // Check the count in the list
        for (int i = 0; i < lst.size(); i++) {
            if (evenList.get(i).getValue0() > oddList.get(i).getValue0()) {
                answer.add(String.format("the number of odd elements in the string %d of the input.", oddList.get(i).getValue0()));
            } else {
                answer.add(String.format("the number of even elements in the string %d of the input.", evenList.get(i).getValue0()));
            }
        }
        // Return the answer
        return answer;

